import React, { useContext, useState } from 'react';
import { AuthContext } from '../../context/authContext';
import Logo from '../logo';

const VerRuta = () => {
  const { setAuth } = useContext(AuthContext);
  const [rutas, setRutas] = useState([
    { idRuta: 'R105', idAsignacion: 'A105', nombrePasajero: 'PERSONA 1', direccion: 'AV 105' },
    { idRuta: 'R105', idAsignacion: 'A107', nombrePasajero: 'PERSONA 2', direccion: 'AV 205' },
    { idRuta: 'R105', idAsignacion: 'A104', nombrePasajero: 'PERSONA 3', direccion: 'AV 109' },
    { idRuta: 'R105', idAsignacion: 'A112', nombrePasajero: 'PERSONA 4', direccion: 'AV 107' },
  ]);

  const handleVolverAlPanel = () => {
    // Aquí iría la lógica para volver al panel principal
  };

  const styles = {
    container: {
      fontFamily: 'Arial, sans-serif',
      maxWidth: '800px',
      margin: '0 auto',
      padding: '20px',
    },
    title: {
      backgroundColor: '#4a5d23',
      color: 'white',
      padding: '10px',
      textAlign: 'center' ,
      marginBottom: '20px',
    },
    rutaInfo: {
      backgroundColor: '#ffe4b5',
      padding: '10px',
      marginBottom: '20px',
      borderRadius: '5px',
    },
    table: {
      width: '100%',
      borderCollapse: 'collapse' ,
      marginBottom: '20px',
    },
    th: {
      backgroundColor: '#d2b48c',
      border: '1px solid #ddd',
      padding: '8px',
      textAlign: 'left',
    },
    td: {
      border: '1px solid #ddd',
      padding: '8px',
    },
    button: {
      padding: '5px 10px',
      backgroundColor: '#4a5d23',
      color: 'white',
      border: 'none',
      borderRadius: '3px',
      cursor: 'pointer',
    },
    mapPreview: {
      width: '100%',
      height: '200px',
      backgroundColor: '#e6e6e6',
      display: 'flex',
      justifyContent: 'center',
      alignItems: 'center',
      marginBottom: '20px',
    },
    volverButton: {
      width: '100%',
      padding: '10px',
      backgroundColor: '#9b8250',
      color: 'white',
      border: 'none',
      borderRadius: '5px',
      cursor: 'pointer',
      fontSize: '16px',
    },
  };

  return (
    <div>
      < Logo/>
    <div style={styles.container}>
      
      <h1 style={styles.title}>VER RUTA</h1>
      <div style={styles.rutaInfo}>
        <p>MI RUTA INICIA A LAS 7:00 Y TERMINA A LAS 8:00</p>
      </div>
      <table style={styles.table}>
        <thead>
          <tr>
            <th style={styles.th}>ID RUTA</th>
            <th style={styles.th}>ID ASIGNACIÓN</th>
            <th style={styles.th}>NOMBRE PASAJERO</th>
            <th style={styles.th}>DIRECCIÓN</th>
            <th style={styles.th}>ACCIÓN</th>
          </tr>
        </thead>
        <tbody>
          {rutas.map((ruta, index) => (
            <tr key={index}>
              <td style={styles.td}>{ruta.idRuta}</td>
              <td style={styles.td}>{ruta.idAsignacion}</td>
              <td style={styles.td}>{ruta.nombrePasajero}</td>
              <td style={styles.td}>{ruta.direccion}</td>
              <td style={styles.td}>
                <button style={styles.button}>Ver + Detalles</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div style={styles.mapPreview}>
        <p>VISTA PREVIA DIRECCIÓN GOOGLE MAPS</p>
      </div>
      <button style={styles.volverButton} onClick={handleVolverAlPanel}>
        VOLVER AL PANEL
      </button>
    </div>
    </div>
  );
};

export default VerRuta;
